// frontend/components/Navigation.jsx
import React from 'react';
const Navigation = () => {
  return (
    <main>
      {/* <section className="glass"> */}
        <div className="menu-sidebar">
          <img className="logo" src="da-logo4.svg" alt="logo" />
          <ul className="menu">
            <li className="menu-item">
              <a href="home"><i className="fas fa-home"></i> Home</a>
            </li>
            <li className="menu-item">
              <a href="profile"><i className="fas fa-chart-bar"></i> Profile</a>
            </li>
            <li className="menu-item">
              <a href="payroll"><i className="fas fa-users"></i> Payroll</a>
            </li>
            <li className="menu-item">
              <a href="settings"><i className="fas fa-cog"></i> Settings</a>
            </li>
            <li className="menu-item">
              <a href="logout"><i className="fas fa-sign-out-alt"></i> Logout</a>
            </li>
          </ul>   
        </div>

      {/* </section> */}
    </main>
  );
};

export default Navigation;
